import React from "react";
import "../src/css/wit.css";
function Wit() {
  return (
    <div className="wmain">
      <div className="wbody">
        <div className="wh">WITHDRAW</div>
        <label htmlFor="amount">THE MINIMUM AMOUNT TO BE WITHDRAW IS 20</label>
        <input name="amount"type="number" placeholder="ENTER THE AMOUNT" />
        <button></button>
      </div>
    </div>
  );
}
export default Wit;
